import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';
import { SafeAreaView } from "react-native-safe-area-context"

export default function HomeScreen() {

  return (
    <SafeAreaView>
        <Text>Home</Text>
    </SafeAreaView>
  );
}
